import React, { useEffect, useState } from 'react';
import axios from 'axios';

const OwnerScreen = () => {
  const [codDetails, setCodDetails] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    axios.get('http://127.0.0.1:8000/api/cod-details/')
      .then(response => {
        setCodDetails(response.data);
        setLoading(false);
      })
      .catch(error => {
        setError('Error fetching data');
        setLoading(false);
      });
  }, []);

  if (loading) return <p>Loading...</p>;
  if (error) return <p>{error}</p>;

  return (
    <div style={{ padding: '20px', textAlign: 'center' }}>
      <h1 style={{ color: '#333', marginBottom: '20px' }}>COD Details</h1>
      <div style={{ overflowX: 'auto' }}>
        <table style={{
          width: '100%',
          borderCollapse: 'collapse',
          borderRadius: '10px',
          boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
          margin: '0 auto',
          backgroundColor: '#fff'
        }}>
          <thead>
            <tr style={{ backgroundColor: '#4CAF50', color: '#fff' }}>
              <th style={{ padding: '12px', borderBottom: '2px solid #ddd', textAlign: 'left' }}>Name</th>
              <th style={{ padding: '12px', borderBottom: '2px solid #ddd', textAlign: 'left' }}>Phone</th>
              <th style={{ padding: '12px', borderBottom: '2px solid #ddd', textAlign: 'left' }}>Email</th>
              <th style={{ padding: '12px', borderBottom: '2px solid #ddd', textAlign: 'left' }}>Address</th>
            </tr>
          </thead>
          <tbody>
            {codDetails.map((detail, index) => (
              <tr key={detail.id} style={{ backgroundColor: index % 2 === 0 ? '#f9f9f9' : '#fff' }}>
                <td style={{ padding: '12px', borderBottom: '1px solid #ddd' }}>{detail.name}</td>
                <td style={{ padding: '12px', borderBottom: '1px solid #ddd' }}>{detail.phone}</td>
                <td style={{ padding: '12px', borderBottom: '1px solid #ddd' }}>{detail.email}</td>
                <td style={{ padding: '12px', borderBottom: '1px solid #ddd' }}>{detail.address}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default OwnerScreen;
